import React, { useState, useEffect } from "react";

import Table from "./Table";
import axios from "axios";

export default function Worklog() {
  const [headers, setHeaders] = useState([]);
  const [data, setData] = useState([]);

  useEffect(() => {
    const getPosts =  () => {
      const data  = [
        {
          "sprint1": 'sprint 1',
          "sprint2": "sunt aut facere repellat provident occaecati excepturi optio reprehenderit",
          "sprint3": "quia et suscipit\nsuscipit recusandae consequuntur expedita "
        },
        {
            "sprint4": 'sprint 1',
            "sprint5": "sunt aut facere repellat provident occaecati excepturi optio reprehenderit",
            "sprint6": "quia et suscipit\nsuscipit recusandae consequuntur expedita "
          },
       ];
      setData(data);
      setHeaders(Object.keys(data[0]));

    };

    getPosts();
  }, []);

  return (
    <div>
      <h1>Hello StackBlitz!</h1>
      <Table headers={headers} data={data} />
    </div>
  );
}
